import React from 'react';
import './Indice.css';

export default function Indice() {
  return (
    <div className="indice-container">
        <nav>
            <a href="#">EncontreProfissionais</a>
            <button >Entrar</button>
            <button >Registrar-se</button>

        </nav>
    </div>
  );
}
